import "../styles/EditButtons.css";

import React from "react";

import PropTypes from "prop-types";
import {
  withStyles,
  MuiThemeProvider
} from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import Button from "@material-ui/core/Button";
import Theme from "../Theme";
const styles = theme => ({
  card: {
    backgroundColor: "primary"
  }
});

class App extends Component {
  render() {
    const { classes } = this.props;
    return (
      <MuiThemeProvider theme={Theme}>
         <Card className={classes.card}>
            <CardActions>
                    <Button
                      variant="raised"
                      color="primary"
                      className={classes.primary}
                    >
                      DOWNLOAD TOOL
                    </Button>
                  </CardActions>
         </Card>
      </MuiThemeProvider>
    );
  }
}

App.propTypes = {
  classes: PropTypes.object.isRequired
};


const EditButtons = ({ handleSave, saveLabel, handleDelete, handleCancel,btnRed}) => (
  <div className="Edit-Buttons">
    <div
      tabIndex="0"
      className="Edit-Button"
      style={{ backgroundColor: "#5aac44" }}
      onClick={handleSave}
    >
      {saveLabel}
    </div>

    {handleDelete && (
      <div
        tabIndex="0"
        className="Edit-Button"
        style={{ backgroundColor: "#EA2525", marginLeft: 0 }}
        onClick={handleDelete}
      >
        Delete
      </div>



    )}


    <div tabIndex="0" className="Edit-Button-Cancel" onClick={handleCancel}>
      <ion-icon name="close" />
    </div>

    <div
    tabIndex="0"
    className="Edit-Button"
    style={{ backgroundColor: "red" }}
    onClick={btnRed}
    >

    </div>
  </div>

);

export default EditButtons;
